import { FC, useEffect, useState } from 'react';
import { Metadata, RecipeType } from '../types/recipe';
import { api } from '../api/axiosConfig';
import { Box, Typography } from '@mui/material';

const Desserts: FC = () => {
  const [desserts, setDesserts] = useState<Metadata[]>([]);

  useEffect(() => {
    api(RecipeType.Desserts)
      .get('/all')
      .then((result) => setDesserts(result.data))
      .catch((reason) => console.error(reason));
  }, []);

  return (
    <Box
      maxWidth={500}
      display="flex"
      alignItems="center"
      alignContent="center"
    >
      <Typography variant="h2">Desserts</Typography>
      {desserts.map((dessert) => (
        <p key={dessert.title}>{dessert.title}</p>
      ))}
    </Box>
  );
};

export default Desserts;
